import React, { Component } from "react";
import sizeMe from 'react-sizeme';
// styles
import './quickArtworkMaker_styles.css';
// comps
import QuickPhotoSelector from "./quickPhotoSelector/QuickPhotoSelector";
import QuickArtworkRoom from "./quickArtworkRoom/QuickArtworkRoom";
import * as ImageHelper from "../ArtStudio/ImageHelper";
import QuickArtwork from "./quickArtwork/QuickArtwork";
import QuickCropAndRotate from "./quickCropAndRotate/QuickCropAndRotate";
import QuickArtMakerTools from "./quickArtMakerTools/QuickArtMakerTools";
import QuickShare from "./quickShare/QuickShare";

class QuickArtworkMaker extends Component {

    constructor(props) {
        super(props);

        this.onPhotoSelect = this.onPhotoSelect.bind(this);
        this.onToolSelect = this.onToolSelect.bind(this);

        this.state = { artworkData: null, currentTool: 'upload' };
    }

    // TEST ONLY
    componentDidMount() {
        this.setState({ artworkData: testArtworkData, currentTool: 'share' })
    }

    onToolSelect(toolName) {
        this.setState({ currentTool: toolName })
    }

    onPhotoSelect(imgFile) {
        ImageHelper.GetImage(imgFile,
            (sourceImg, imgOrientation, widthToHeightRatio, heightToWidthRatio) => {
                this.setState({
                    artworkData: {
                        sourceImg, widthToHeightRatio, heightToWidthRatio
                    },
                    currentTool: 'view'
                });
            });
    }

    render() {
        const { artworkData, currentTool } = this.state;
        const { height, width } = this.props.size;
        const floorPercentage = 0.10;
        const floorHeight = height * floorPercentage;
        const sidebarWidth = 70;
        const contentWidth = width - sidebarWidth;
        const wallHeight = height - floorHeight;

        return (
            <div className={'quickArtworkMaker'}>

                <QuickArtworkRoom height={height}
                                  floorHeight={floorHeight}/>

                <div className={'quickArtworkMaker--sideBar'} style={{width:sidebarWidth}}>
                    <QuickArtMakerTools onToolSelect={this.onToolSelect}/>
                </div>

                <div className={'quickArtworkMaker--main'}>

                    {currentTool === 'view' &&
                    <QuickArtwork height={wallHeight}
                                  width={contentWidth}
                                  artworkData={artworkData}/>
                    }

                    {currentTool === 'crop' &&
                    <QuickCropAndRotate sourceImg={artworkData.sourceImg}
                                        width={contentWidth}
                                        height={height}/>
                    }

                    {currentTool === 'share' &&
                    <QuickShare artworkData={artworkData}
                                width={contentWidth}
                                height={wallHeight}/>
                    }

                    {currentTool === 'upload' &&
                    <div className={'quickArtworkMaker--photoSelectorHolder'}>
                        <QuickPhotoSelector onPhotoSelected={this.onPhotoSelect}/>
                    </div>
                    }
                </div>
            </div>
        );
    }
}

export default sizeMe({ monitorHeight: true })(QuickArtworkMaker);


const testImg = "data:image/png;base64,";
let img = new Image();
img.src = testImg;
const testArtworkData = { sourceImg: img, widthToHeightRatio: 0.64, heightToWidthRatio: 1.56 };